Jake has to walk to the 7th floor in order to see the next exhibit, but Jake has to take the elevator to the 2nd floor so that he may take the stairs to the 7th floor. The elevator has 5 floors that are skipped on the way up. He wants to see the 5th exhibit so he has to go up 2 floors to the 3rd floor so that he can take the stairs to the 5th floor. What is the number of floors that Jake has to walk up in order to see the 5th exhibit? This is a classic problem of: A) The number of legs of the invertebrates Jake sees. B) The number of floors that Jake has to walk up. C) The number of floors that Jake skips. D) The number of floors that Jake walks up in order to see the 5th exhibit. E) The number of floors that Jake has to walk up in order to see the 5th exhibit in the most efficient way.
Answer: E
